import React from 'react';
import ReactDOM from 'react-dom';
import './equipo.css';
import Header from './componentes/header/header';
import Nav from './componentes/nav/nav';
import Footer from'./componentes/footer/footer';

function Equipo(){
	return (
    <div>
    <Header />
    <Nav />
    <Section />
    <Footer />
    </div>
);
}

export default Equipo;
